import classes from "./Header.module.css"
import bookcafe from "../../assets/bookcafe.png"
import menu from "../../assets/menu.png"

function Header (){
   return (
   <div className={classes.headerWrap}>
      <a href="/home"><img src={bookcafe} className={classes.bookImg} alt="bookcafe"/></a>
      <div className={classes.menuWrap}>
         <img className={classes.menuImg} src={menu} alt="menu"/>
      </div>
      <div className={classes.reservation}>
         <a href="/contact" style={{textDecoration:"none"}}>
            <span className={classes.reservationText}>R E S E R V A T I O N</span>
            </a>         
      </div>
   </div>
   )
};

export default Header;
